import React from "react";
import "./Header.css";

const Header = () => {
  return (
    <header className="header">
      <h1 className="title">ファビアチェック</h1>
      <p className="subtitle">ファビア（恐怖症）を持つ方のための映画情報サイト</p>
    </header>
  );
};

export default Header;
